contracts/000-bid-contract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Auction {
    address payable public owner;
    uint public endTime;
    address payable public highestBidder;
    uint public highestBid;
    mapping(address => uint) public bids;
    uint public minimumIncrease = 5; // Porcentaje mínimo de incremento

    event NewBid(address indexed bidder, uint amount, uint endTime);
    event AuctionEnded(address indexed winner, uint winningBid);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    modifier auctionActive() {
        require(block.timestamp < endTime, "Auction has ended");
        _;
    }

    constructor(uint _endTime) {
        owner = payable(msg.sender);
        endTime = _endTime;
    }

    function bid() public payable auctionActive {
        require(msg.value > highestBid * (100 + minimumIncrease) / 100, "Bid too low");
        // Reembolso del exceso de la última puja
        if (bids[msg.sender] > 0) {
            payable(msg.sender).transfer(bids[msg.sender]);
        }
        highestBidder = payable(msg.sender);
        highestBid = msg.value;
        bids[msg.sender] = msg.value;
        endTime = block.timestamp + 600; // Extender 10 minutos si falta menos de 10 minutos
        emit NewBid(msg.sender, msg.value, endTime);
    }

    function getWinner() public view returns (address, uint) {
        return (highestBidder, highestBid);
    }

    function getBids() public view returns (address[] memory, uint[] memory) {
        // Implementar la lógica para obtener una lista de todos los ofertantes y sus pujas
        // ...
    }

    function withdrawExcess() public auctionActive {
        uint excess = bids[msg.sender] - highestBid;
        if (excess > 0) {
            payable(msg.sender).transfer(excess);
            bids[msg.sender] = highestBid; // Actualizar el saldo del ofertante
        }
    }

    function withdrawBids(address payable[] memory bidders) public onlyOwner {
        require(block.timestamp >= endTime, "Auction has not ended");
        for (uint i = 0; i < bidders.length; i++) {
            uint amount = bids[bidders[i]];
            // Descontar una comisión del 2%
            uint fee = amount * 2 / 100;
            payable(bidders[i]).transfer(amount - fee);
            delete bids[bidders[i]];
        }
    }
}

